import React from 'react';
import ReactDOM from 'react-dom';

//react routing
import { render } from "react-dom";
import { BrowserRouter } from "react-router-dom";

//components
import App from './App';



ReactDOM.render(
  	<React.StrictMode>
		<BrowserRouter>

			<App />
		</BrowserRouter>

	</React.StrictMode>,
	document.getElementById('root')
);

